import Tshirts from './pages/Products/Tshirts/Tshirts.jsx';
import Balls from './pages/Products/Balls/Balls.jsx';
import Accessoires from './pages/Products/Accessoires/Accessoires.jsx';


function App() {
  return (
    <div className="App">
      {/* NavBar*/}
      <NavBar/>
      {/* Routes*/}
       <Routes>
        <Route path ='/' element = {<Home/>} />
