             <Route path="/shoes" element={<Shoes />} />
             <Route path="/tshirts" element={<Tshirts />} />
             <Route path="/balls" element={<Balls />} />
             <Route path="/accessoires" element={<Accessoires />} />
                <Route path="/BasketBall -Jersey" element={<BasketBall-Jersey />} />

       </Routes>
      {/* Footer*/}
    </div>
  );
}
